import React, { Component } from 'react';
import '../assets/css/Dashboard.css';
import {
  BarChart,
  Bar,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
  Label,
} from 'recharts';
import { Form } from 'react-bootstrap';


class BarGraphCard extends Component {


  constructor(props) {
    super(props);
    this.state = {

    }
  }

  toggle = () =>{

  }

  render() {

    const { graphData, type, isModel } = this.props;

    const selectModel = () => {
      return (
        <div className="model-form">
        <Form >
          <Form.Check
            type="checkbox"
            id="checkbox"
            label="s60"
          />
          <Form.Check
            type="checkbox"
            id="checkbox"
            label="xc90"
          />
          <Form.Check
            type="checkbox"
            id="checkbox"
            label="xc40"
          />
        </Form>
        </div>
      )
    }

    return (
      <div className="card-big-container">
        <div className="card-title">
          {type}
          {isModel ? selectModel() : null}
        </div>
        <ResponsiveContainer width={310} height="75%" className="chart-container">
          <BarChart data={graphData} margin={{top: 5, bottom: 5, left: -30}}>
           <XAxis dataKey="time"/>
           <YAxis/>
           <Tooltip/>
           <Bar dataKey="count" fill="#A6CEE3" />
          </BarChart>
        </ResponsiveContainer>

      </div>
    )

  }

}



export default BarGraphCard;
